css:
.footer-html table td, .footer-html table th {
    padding: 0px !important;
}

.footer-content {
    width: 100%;
    padding: 10px 20px;
    position: relative;
}

.footer-content::after {
    content: "";
    display: table;
    clear: both;
}

.page-number {
    float: left;
    width: 80%;
    font-size: 11px;
    text-align: center;
    line-height: 70px;
}

.signature-wrapper {
    float: right;
    width: 20%;
    text-align: right;
}

.signature-table {
    border-collapse: collapse;
    border: 1px solid #000;
    display: inline-table;
    margin: 0;
}

.signature-table td {
    border: 1px solid #000;
    padding: 5px 15px;
    text-align: center;
    font-size: 11px;
}

.signature-space {
    height: 50px;
}
